description:
Study Guide: http://prophesyagain.org/wp-content/uploads/2015/05/Martyrs-Before-The-General-Close-of-Probation.pdf

A great work is to be accomplished; broader plans must be laid; a voice must go forth to arouse the nations. Men whose faith is weak and wavering are not the ones to carry forward the work at this important crisis. We need the courage of heroes and the faith of martyrs.  {5T 187.4}  
 There is a picture representing a bullock standing between a plow and an altar, with the inscription, Ready for either, ready to toil in the furrow or to be offered on the altar of sacrifice. This is the position of the true child of God--willing to go where duty calls, to deny self, to sacrifice for the Redeemer's cause.  {MH 502.5} 
 It is not for me to decide whether my life or my death will contribute most to the salvation of all. . . . You may expect everything from me. . . except flight and recantation. Fly I cannot, and still less retract."  {GC 146.1}
